import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './components/Home';
import Hospitals from './components/Hospitals';
import Medicals from './components/Medicals';
import Diagnostics from './components/Diagnostics';

function App() {
  const [searchResults, setSearchResults] = useState(null);

  const handleSearch = (query, filter) => {
    // Implement logic to filter based on the query and filter
    // For demonstration, we'll just set some dummy data
    const filteredResults = { hospitals: [], medicals: [], diagnostics: [] };

    // Populate filteredResults based on query and filter
    
    setSearchResults(filteredResults);
  };

  return (
    <Router>
      <div>
        <Navbar onSearch={handleSearch} />
        <Routes>
          <Route path="/" exact element={<Home />} />
          <Route path="/hospitals" element={<Hospitals />} />
          <Route path="/medicals" element={<Medicals />} />
          <Route path="/diagnostics" element={<Diagnostics />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
